import {useState} from "react";


function Effect(){

  const [count, setCount] = useState(0);

  const onClick = () => {
    setCount(count + 1);
  }

  return (
    <div>
      <h1>Number of Count : {count}</h1>
      <button onClick={onClick}>Count up</button>
    </div>
  )
}

export default Effect;
